impl Solution {
    pub fn beautiful_indices(s: String, a: String, b: String, k: i32) -> Vec<i32> {
        let mut results = Vec::new();
        let s_len = s.len();
        let a_len = a.len();
        let b_len = b.len();

        'outer: for i in 0..=s_len.saturating_sub(a_len) {
            if s[i..i + a_len] == a {
                for j in 0.max(i as i32 - k) as usize..=s_len.saturating_sub(b_len) {
                    if (i as i32 - j as i32).abs() <= k && s[j..j + b_len] == b {
                        results.push(i as i32);
                        continue 'outer;
                    }
                }
            }
        }

        results
    }
}
